(function($, window, document, undefined) {

	'use strict';

	$(function() {
	  
		if ( $('#nav_search').length ) {
			var suggestBox;
			// retrieve the api url from data-json
			var jsonsrc = $('#nav_search').data('json');
			// get the json
			$.getJSON( jsonsrc, function( json ) {
				// when json has arrived, initialize the suggestBox plugin
				$('#suggestBox').jsonSuggest( {
					data: json,
					// choosing an item loads the linked page after a brief delay
					onSelect: function(item) {
						setTimeout(function() {
							window.location.href = item.id;
						}, 200);
						return false;
					},
					maxHeight: 9999
				});
			});
		}

	});

})(jQuery, window, document);
